import React from 'react'
import netflix_poster from '../Images/netflix_poster.jpg';

const Navbar = () => {
    return (
        <div>
            <img src={netflix_poster} alt="poster" className='-z-1' />
        <h1>This is my Car</h1>
        </div>
    )
}

export default Navbar
